import React from 'react'
import {StyleSheet, View} from 'react-native'
import Navbar from '../components/navbar'

const Home = () =>{
    return (
        <View style={styles.home}>
            <Navbar style={styles.navbar} />
        </View>
    )
}
const styles = StyleSheet.create({
    navbar:{
        flex: 1,
    },
    home:{
        flex:3,
        flexDirection: 'column'
    }
})
export default Home
